// Hair by AMR - Basic React Website Skeleton

import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="p-4 bg-black text-white flex justify-between">
      <h1 className="text-xl font-bold">Hair by AMR</h1>
      <ul className="flex gap-4">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/shop">Shop</Link></li>
        <li><Link to="/color-chart">Hair Color Chart</Link></li>
        <li><Link to="/supplies">Supplies</Link></li>
        <li><Link to="/about">About Me</Link></li>
        <li><Link to="/faq">FAQ</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
    </nav>
  );
}

function Home() {
  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-4">Get Started with a Hair System</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6 text-center">
        <div className="p-4 border rounded shadow">
          <h3 className="text-xl font-semibold mb-2">1. Pick Your Hair Color</h3>
          <p>Select the shade that best matches your natural hair.</p>
        </div>
        <div className="p-4 border rounded shadow">
          <h3 className="text-xl font-semibold mb-2">2. Get a Template Cut</h3>
          <p>Send us your head measurements using our instructions.</p>
        </div>
        <div className="p-4 border rounded shadow">
          <h3 className="text-xl font-semibold mb-2">3. Order a Starter Kit</h3>
          <p>Receive your unit and start your hair journey!</p>
        </div>
      </div>
    </div>
  );
}

function Shop() { return <div className="p-6">Shop Page</div>; }
function ColorChart() { return <div className="p-6">Hair Color Chart Page</div>; }
function Supplies() { return <div className="p-6">Supply Page</div>; }
function About() { return <div className="p-6">About Me Page</div>; }
function FAQ() { return <div className="p-6">FAQ Page</div>; }
function Contact() {
  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Contact Us</h2>
      <form className="grid grid-cols-1 gap-4 max-w-lg">
        <input className="border p-2" type="text" placeholder="Name" required />
        <input className="border p-2" type="email" placeholder="Email" required />
        <textarea className="border p-2" rows="4" placeholder="Message" required></textarea>
        <button type="submit" className="bg-black text-white p-2 rounded">Send</button>
      </form>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/shop" element={<Shop />} />
        <Route path="/color-chart" element={<ColorChart />} />
        <Route path="/supplies" element={<Supplies />} />
        <Route path="/about" element={<About />} />
        <Route path="/faq" element={<FAQ />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
}

export default App;
